import WhiteTypography from "./WhiteTypography"
import { Grid } from "@mui/material"
import SkillCard from "./SkillCard"
import skillData from "../data/skillData"

export default function SkillsBox() {
    return (
        <>
            <WhiteTypography gutterBottom variant="h4" component="div" style={{ marginBottom: "3rem" }}>
                My Skills
            </WhiteTypography>
            <Grid container rowSpacing={10} style={{ justifyContent: 'space-around' }}>
                {skillData.map((item, index) => (
                    <Grid xs={4} key={index}>
                        <SkillCard name={item.name} level={item.level}/>
                    </Grid>
                ))}
            </Grid>
        </>
    )
}
